import styled from "styled-components";

export const Title = styled.h3`
  border-bottom: 1px solid rgb(0, 0, 0);
  padding-bottom: 10px;
  margin: 40px 0 10px;
`;

export const List = styled.ul`
  list-style-type: none;
  padding: 0;
  margin-bottom: 40px;
`;
